import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

const ExamsForUser = () => {
  const [exams, setExams] = useState([]);
  const navigate = useNavigate();
  const partyId = "10040";
  useEffect(() => {
    fetch(`https://localhost:8443/onlineexam/control/showExamsForPartyId`, {
      method: "POST",
      headers: { "Content-type": "application/json" },
      credentials: "include",
      body: JSON.stringify({ partyId }),
    })
      .then((response) => {
        return response.json();
      })
      .then((data) => {
        console.log("data.examlist::::", data.examList);
        setExams(data.examList);
      });
  }, []);

  return (
    <div className="container-fluid ">
      <div className="container-fluid border-bottom border-dark border-3">
        <h2 className="p-2 ">Scheduled Exams</h2>
      </div>
      <div className="mt-1">
      {exams.map((exam) => (
        <div class="accordion" id="accordionExample">
          <div class="accordion-item">
            <h2 class="accordion-header py-3 px-3" id="headingOne">
              <div className="row">
                <div class="col-10">
                  <h5> {exam.examName}</h5>
                </div>
                <div className="col-2">
                  <div className="d-grid gap-2 d-md-flex justify-content-md-end ">
                    <button
                      onClick={() => navigate("/introduction")}
                      className="btn btn-outline-success  me-4 col-8"
                    >
                      Take exam
                    </button>
                  </div>
                </div>
              </div>
            </h2>
          </div>
        </div>
      ))}
    </div>
    </div>
  );
};

export default ExamsForUser;

